import React from "react";
import { ScrollStyle } from "./ScrollStyle";

const Scroll = props => {

    return (

        <ScrollStyle>
            <img className="scroll" src="/static/svg/scroll.svg" />
            <div className="box1"></div>
            <div className="box2"></div>
            <div className="box3"></div>

        </ScrollStyle>
    )

}

export default Scroll;
